    header{
        height:80px;
        background:#000;
        display:flex;
        justify-content:center;
        align-items:center;
    }
    header img{height:75px;width:auto;}
    /* spacing between main blocks */
    section{width:90%;max-width:920px;margin:120px auto;}
    /* overview lines */
    .overview p{margin:6px 0;}
    /* download button */
    .download-btn{
        display:inline-block;
        background:#ff8c00;
        color:#fff;
        font-weight:bold;
        padding:14px 36px;
        border:none;
        border-radius:4px;
        text-decoration:none;
        font-size:1rem;
        transition:opacity .25s;
    }
    .download-btn:hover{opacity:.8;}
    /* usage link */
    .link-btn{color:#0af;text-decoration:underline;font-weight:bold;}
    /* disclaimer block */
    .disclaimer h2{font-size:1.2rem;margin-bottom:12px;}
    .disclaimer p{
        font-size:0.9rem;
        line-height:1.3;
        margin:4px 0;
        font-weight:200;      /* much thinner */
        color:rgba(255,255,255,0.85); /* slightly lighter color */
    }
    footer{margin:120px 0 60px 0;font-size:0.9rem;}
    @media (max-width:480px){
        .download-btn{width:80%;}
        section{margin:80px auto;}
        footer{margin:80px 0 40px 0;}
    }
</style>
</head>
